def find_max_f_value(N, K, A):
    BMAX = 41
    d = [0] * BMAX
    for a in A:
        for i in range(BMAX):
            if a & 1 << i:
                d[i] += 1
    dp = [[-1 for _ in range(2)] for _ in range(BMAX + 1)]
    dp[0][0] = 0
    for i in range(BMAX):
        now = BMAX - 1 - i
        p0 = 2 ** now * d[now]
        p1 = 2 ** now * (N - d[now])
        is_one = K & 1 << now != 0
        if dp[i][1] != -1:
            dp[i + 1][1] = dp[i][1] + max(p1, p0)
        if dp[i][0] != -1 and is_one:
            dp[i + 1][1] = max(dp[i + 1][1], dp[i][0] + p0)
        if dp[i][0] != -1:
            dp[i + 1][0] = dp[i][0] + (p1 if is_one else p0)
    return max(dp[-1])

